import { FaSearch } from "react-icons/fa";
import { MdClear } from "react-icons/md";
import { useState } from "react";
export default () => {
  const [value, setValue] = useState(true);
  return (
    <div className="header-top-right">
      <div id="top-links" className="nav pull-right">
        <ul className="list-inline">
          <li className="ttsearch">
            <div id="search" className="input-group active">
              <span
                className="ttsearch_button"
                onClick={() => {
                  let bo = document.getElementsByTagName("body");
                  value
                    ? bo[0].classList.add("search-open")
                    : bo[0].classList.remove("search-open");
                  setValue(!value);
                }}
              >
                <i className="icon-search">
                  <FaSearch />
                </i>
                <i className="icon-close">
                  <MdClear />
                </i>
              </span>
            </div>
          </li>
        </ul>
      </div>
    </div>
  );
};
